window.bookSummaryJSON = "<p>The team of heroes extracted from their timelines to stop the impending apocalypse didn't think they needed a leader. </p> <p>But they've got one anyway. </p> <p>With their mission in tatters, Miri has been called in to steady the ship. And to focus them on their assignment: preventing the end of the world. </p> <p>The problem is, the world doesn't know it's in danger. With governments pursuing them relentlessly, attempting to steal the time-travel device to use for their own ends, the heroes are on the run - fighting for survival in a world they're supposed to save. </p> <p>Meanwhile, Miri has motives of her own. And when the existence of a second device is discovered, the team's mission and their lives are in mortal danger.... </p>"; 
